create table Vehicle (
	id SERIAL NOT NULL,
	vehicleTypeId INT,
	is_imported boolean,
	has_registration_number boolean,
	brand VARCHAR(50),
	model VARCHAR(50),
	generation VARCHAR(50),
	year_of_production VARCHAR(50),
	mileage INT,
	mileage_unit VARCHAR(2),
	fuelId INT,
	transmissionId INT,
	driveId INT,
	city_fuel_usage INT,
	on_the_road_fuel_usage INT,
	bodyId INT,
	co2_emission INT,
	doors_number INT,
	sits_number INT,
	color VARCHAR(50),
	color_type VARCHAR(50),
	origin_country VARCHAR(50),
	registered_in_poland boolean,
	has_crashed boolean,
	carStatusId INT,
	PRIMARY KEY (id)
);

alter table Vehicle add constraint FKVehicle1 foreign key (vehicleTypeId) references vehicle_type (id);
alter table Vehicle add constraint FKVehicle2 foreign key (fuelId) references fuel_type (id);
alter table Vehicle add constraint FKVehicle3 foreign key (transmissionId) references transmission_type (id);
alter table Vehicle add constraint FKVehicle4 foreign key (driveId) references drive_type (id);
alter table Vehicle add constraint FKVehicle5 foreign key (bodyId) references body_type (id);
alter table Vehicle add constraint FKVehicle6 foreign key (carStatusId) references car_status (id);


